import React, { Component } from "react";
import { connect } from "unistore/react";
import { actions } from "../store.js";
import { withRouter } from "react-router-dom";
import { Redirect } from "react-router-dom";

import romance from "../images/romance.jpg";
import action from "../images/action.jpg";
import fiction from "../images/fiction.jpg";
import comedy from "../images/comedy.jpg";

import "../styles/App.css";

class Home extends Component {
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-md-3 col-sm-12 offset-md-0">
            <div class="card" style={{ width: "75%" }}>
              <a href="./romance">
                <img
                  class="card-img-top"
                  src={romance}
                  alt="Card image"
                  style={{ width: "100%" }}
                />
              </a>

              <div class="card-body" style={{ marginTop: "10px" }}>
                <a
                  href="./romance"
                  class="btn btn-primary stretched-link"
                  style={{ marginLeft: "5%" }}
                >
                  See Movies
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

// export default connect(
//     "is_login, email, full_name",
//     actions
// )(withRouter(Home));

export default Home;
